import './App.css';
import Navbar from './component/navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import "bootstrap/dist/css/bootstrap.min.css";
import MovieInfo from './pages/level1/movieInfo';
import MovieList from './pages/level1/movielist';

function App() {
  return (
     <Router>

       <Navbar/>
        <Switch>
        <Route>

          <Route path="/movieinfo" component={MovieInfo} exact />
          <Route path="/movielist" component={MovieList} exact />
          {/* <Route path="/" element={<CardView />} />
          <Route path="/login" element={<Login />}  />
          <Route path="/signup" element={<SignUp />}  />
          <Route path="/film/:id" element={<Film />} />
          <Route path="/favmovie" element={<FavMovie />} /> */}
        </Route>
        </Switch>
      </Router>
  );
}

export default App;
